public class InnerUserHierarchyStructureUserHierarchyStructureFactory(Action<Humidifier.Connect.UserHierarchyStructureTypes.UserHierarchyStructure> factoryAction = null) : SubResourceFactory<Humidifier.Connect.UserHierarchyStructureTypes.UserHierarchyStructure>
{

    internal InnerUserHierarchyStructureLevelThreeFactory LevelThreeFactory { get; set; }

    internal InnerUserHierarchyStructureLevelTwoFactory LevelTwoFactory { get; set; }

    internal InnerUserHierarchyStructureLevelFiveFactory LevelFiveFactory { get; set; }

    internal InnerUserHierarchyStructureLevelFourFactory LevelFourFactory { get; set; }

    internal InnerUserHierarchyStructureLevelOneFactory LevelOneFactory { get; set; }

    protected override Humidifier.Connect.UserHierarchyStructureTypes.UserHierarchyStructure Create()
    {
        var userHierarchyStructureResult = CreateUserHierarchyStructure();
        factoryAction?.Invoke(userHierarchyStructureResult);

        return userHierarchyStructureResult;
    }

    private Humidifier.Connect.UserHierarchyStructureTypes.UserHierarchyStructure CreateUserHierarchyStructure()
    {
        var userHierarchyStructureResult = new Humidifier.Connect.UserHierarchyStructureTypes.UserHierarchyStructure();

        return userHierarchyStructureResult;
    }
    public override void CreateChildren(Humidifier.Connect.UserHierarchyStructureTypes.UserHierarchyStructure result)
    {
        base.CreateChildren(result);

        result.LevelThree ??= LevelThreeFactory?.Build();
        result.LevelTwo ??= LevelTwoFactory?.Build();
        result.LevelFive ??= LevelFiveFactory?.Build();
        result.LevelFour ??= LevelFourFactory?.Build();
        result.LevelOne ??= LevelOneFactory?.Build();
    }

} // End Of Class

